import React from "react"
import logo from '../react-logo.png';

export default function Navbar(){
    return(
        <nav className = "nav">
            <img className = "nav-logo" src={logo}></img>
            <ul className = "nav-items">
                <li>Pricing</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}
